/** Implementation of the MethodManager interface method beginCall
*/
UaStatus UnicastStaticForwardFolderTypeBase::beginCall(
    MethodManagerCallback* pCallback,
    const ServiceContext&  serviceContext,
    OpcUa_UInt32           callbackHandle,
    MethodHandle*          pMethodHandle,
    const UaVariantArray&  inputArguments)
{
    UaStatus            ret;

    OpcUa::MethodCallJob* pCallJob = new OpcUa::MethodCallJob;
    pCallJob->initialize(this, pCallback, serviceContext, callbackHandle, pMethodHandle, inputArguments);
    ret = NodeManagerRoot::CreateRootNodeManager()->pServerManager()->getThreadPool()->addJob(pCallJob);
    if ( ret.isBad() )
    {
        delete pCallJob;
    }

    return ret;
}

/** Synchronous version of the MethodManager method call executed in a worker thread
*/
UaStatus UnicastStaticForwardFolderTypeBase::call(
    const ServiceContext&  serviceContext,
    MethodHandle*          pMethodHandle,
    const UaVariantArray&  inputArguments,
    UaVariantArray&        outputArguments,
    UaStatusCodeArray&     inputArgumentResults,
    UaDiagnosticInfos&     inputArgumentDiag)
{
    UaStatus            ret;
    MethodHandleUaNode* pMethodHandleUaNode = (MethodHandleUaNode*)pMethodHandle;
    UaMethod*           pMethod             = NULL;

    if (pMethodHandleUaNode)
    {
        pMethod = pMethodHandleUaNode->pUaMethod();

        if (pMethod)
        {
            if ( ( (m_pAddUnicastStaticForwardMethod != NULL) && (pMethod->nodeId() == m_pAddUnicastStaticForwardMethod->nodeId()) )
                 || ( (s_pAddUnicastStaticForwardMethod != NULL) && (pMethod->nodeId() == s_pAddUnicastStaticForwardMethod->nodeId()) ) )
            {
                if ( inputArguments.length() < 1 )
                {
                    ret = OpcUa_BadArgumentsMissing;
                }
                else if ( inputArguments.length() > 1 )
                {
                    ret = OpcUa_BadTooManyArguments;
                }
                else
                {
                    inputArgumentResults.create(1);

                    UaNodeId NodeId;
                    OpcUa_UInt32 ErrorCode = 0;
                    UaString ErrorMessage;
                    UaVariant value;
                    UaStatus tmpRet;

                    MoxaClassBased::UnicastStaticForwardDataType Configuration;
                    value = inputArguments[ 0 ];
                    UaExtensionObject extConfiguration;
                    value.toExtensionObject(extConfiguration);
                    tmpRet = Configuration.setUnicastStaticForwardDataType(extConfiguration, OpcUa_True);
                    inputArgumentResults[ 0 ] = tmpRet.statusCode();
                    if (tmpRet.isNotGood()) {ret = tmpRet;}

                    if ( ret.isGood() )
                    {
                        ret = this->AddUnicastStaticForward(serviceContext, Configuration, NodeId, ErrorCode, ErrorMessage);
                    }
                    if ( ret.isNotBad() )
                    {
                        outputArguments.create(3);
                        value.setNodeId(NodeId);
                        outputArguments[ 0 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                        value.setUInt32(ErrorCode);
                        outputArguments[ 1 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                        value.setString(ErrorMessage);
                        outputArguments[ 2 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                    }
                }

            }
            else if ( ( (m_pRemoveUnicastStaticForwardMethod != NULL) && (pMethod->nodeId() == m_pRemoveUnicastStaticForwardMethod->nodeId()) )
                      || ( (s_pRemoveUnicastStaticForwardMethod != NULL) && (pMethod->nodeId() == s_pRemoveUnicastStaticForwardMethod->nodeId()) ) )
            {
                if ( inputArguments.length() < 1 )
                {
                    ret = OpcUa_BadArgumentsMissing;
                }
                else if ( inputArguments.length() > 1 )
                {
                    ret = OpcUa_BadTooManyArguments;
                }
                else
                {
                    inputArgumentResults.create(1);

                    OpcUa_UInt32 ErrorCode = 0;
                    UaString ErrorMessage;
                    UaVariant value;
                    UaStatus tmpRet;

                    UaNodeId NodeId;
                    value = inputArguments[ 0 ];
                    tmpRet = value.toNodeId(NodeId);
                    inputArgumentResults[ 0 ] = tmpRet.statusCode();
                    if (tmpRet.isNotGood()) {ret = tmpRet;}

                    if ( ret.isGood() )
                    {
                        ret = this->RemoveUnicastStaticForward(serviceContext, NodeId, ErrorCode, ErrorMessage);
                    }
                    if ( ret.isNotBad() )
                    {
                        outputArguments.create(2);
                        value.setUInt32(ErrorCode);
                        outputArguments[ 0 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                        value.setString(ErrorMessage);
                        outputArguments[ 1 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                    }
                }

            }
            else if ( ( (m_pSetUnicastStaticForwardMethod != NULL) && (pMethod->nodeId() == m_pSetUnicastStaticForwardMethod->nodeId()) )
                      || ( (s_pSetUnicastStaticForwardMethod != NULL) && (pMethod->nodeId() == s_pSetUnicastStaticForwardMethod->nodeId()) ) )
            {
                if ( inputArguments.length() < 1 )
                {
                    ret = OpcUa_BadArgumentsMissing;
                }
                else if ( inputArguments.length() > 1 )
                {
                    ret = OpcUa_BadTooManyArguments;
                }
                else
                {
                    inputArgumentResults.create(1);

                    OpcUa_UInt32 ErrorCode = 0;
                    UaString ErrorMessage;
                    UaVariant value;
                    UaStatus tmpRet;

                    MoxaClassBased::UnicastStaticForwardDataType Configuration;
                    value = inputArguments[ 0 ];
                    UaExtensionObject extConfiguration;
                    value.toExtensionObject(extConfiguration);
                    tmpRet = Configuration.setUnicastStaticForwardDataType(extConfiguration, OpcUa_True);
                    inputArgumentResults[ 0 ] = tmpRet.statusCode();
                    if (tmpRet.isNotGood()) {ret = tmpRet;}

                    if ( ret.isGood() )
                    {
                        ret = this->SetUnicastStaticForward(serviceContext, Configuration, ErrorCode, ErrorMessage);
                    }
                    if ( ret.isNotBad() )
                    {
                        outputArguments.create(2);
                        value.setUInt32(ErrorCode);
                        outputArguments[ 0 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                        value.setString(ErrorMessage);
                        outputArguments[ 1 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                    }
                }

            }
            else
            {
                return FolderType::call(serviceContext, pMethodHandle, inputArguments, outputArguments, inputArgumentResults, inputArgumentDiag);
            }
        }
        else
        {
            assert(false);
            ret = OpcUa_BadInvalidArgument;
        }
    }
    else
    {
        assert(false);
        ret = OpcUa_BadInvalidArgument;
    }

    return ret;
}

